import {StyleSheet} from 'react-native';
import {CuraColor} from '../../util';

export default StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: CuraColor.DarkGreen,
    color: CuraColor.White,
  },
  navbar: {
    flex: 0.1,
  },
  content: {
    flex: 0.9,
    justifyContent: 'center',
    alignItems: 'center',
    color: CuraColor.White,
  },
});
